import React, { useState } from "react";

function TravelPlanner() {
  const [destination, setDestination] = useState("");
  const [tripDuration, setTripDuration] = useState("");
  const [interests, setInterests] = useState("Adventure");
  const [budget, setBudget] = useState("Mid-range");
  const [city, setCity] = useState("");
  const [itinerary, setItinerary] = useState(null);
  const [weather, setWeather] = useState(null);

  const fetchItinerary = async () => {
    if (!destination || !tripDuration) return alert("Please fill all fields.");
    try {
      const response = await fetch(
        `http://127.0.0.1:8000/api/itinerary?destination=${destination}&days=${tripDuration}&interests=${interests}&budget=${budget}`
      );
      const data = await response.json();
      setItinerary(data);
    } catch (error) {
      console.error("Error fetching itinerary:", error);
    }
  };

  const fetchWeather = async () => {
    if (!city) return alert("Please enter a city.");
    try {
      const response = await fetch(`http://127.0.0.1:8000/api/weather?city=${city}`);
      const data = await response.json();
      setWeather(data);
    } catch (error) {
      console.error("Error fetching weather:", error);
    }
  };

  return (
    <div style={{ textAlign: "center", fontFamily: "Arial, sans-serif", padding: "20px" }}>
      <h1>üåç AI Travel Planner</h1>

      {/* Itinerary Inputs */}
      <div>
        <input
          type="text"
          placeholder="Enter destination (e.g., Italy)"
          value={destination}
          onChange={(e) => setDestination(e.target.value)}
          style={styles.input}
        />
        <input
          type="number"
          placeholder="Trip Duration (Days)"
          value={tripDuration}
          onChange={(e) => setTripDuration(e.target.value)}
          style={styles.input}
        />
        <select value={interests} onChange={(e) => setInterests(e.target.value)} style={styles.select}>
          <option>Adventure</option>
          <option>History</option>
          <option>Food</option>
          <option>Nature</option>
        </select>
        <select value={budget} onChange={(e) => setBudget(e.target.value)} style={styles.select}>
          <option>Budget</option>
          <option>Mid-range</option>
          <option>Luxury</option>
        </select>
        <button onClick={fetchItinerary} style={styles.buttonBlue}>
          Get Itinerary
        </button>
      </div>

      {/* Weather Input */}
      <div>
        <input
          type="text"
          placeholder="Enter city (e.g., New York)"
          value={city}
          onChange={(e) => setCity(e.target.value)}
          style={styles.input}
        />
        <button onClick={fetchWeather} style={styles.buttonGreen}>
          Get Weather
        </button>
      </div>

      {/* Display Itinerary */}
      {itinerary && (
        <div style={styles.box}>
          <h2>üìå Itinerary for {destination}</h2>
          <p>{itinerary.itinerary}</p>
        </div>
      )}

      {/* Display Weather */}
      {weather && (
        <div style={styles.box}>
          <h2>üå§ Weather in {city}</h2>
          <p>Temperature: {weather.weather.temperature}¬∞C</p>
          <p>Condition: {weather.weather.description}</p>
          <p>üîπ Travel Tip: {weather.weather.tip}</p>
        </div>
      )}
    </div>
  );
}

// CSS-in-JS for styling
const styles = {
  input: {
    padding: "10px",
    margin: "5px",
    borderRadius: "5px",
    border: "1px solid #ccc",
    width: "200px",
  },
  select: {
    padding: "10px",
    margin: "5px",
    borderRadius: "5px",
  },
  buttonBlue: {
    padding: "10px",
    borderRadius: "5px",
    background: "blue",
    color: "white",
    cursor: "pointer",
  },
  buttonGreen: {
    padding: "10px",
    borderRadius: "5px",
    background: "green",
    color: "white",
    cursor: "pointer",
  },
  box: {
    marginTop: "20px",
    padding: "15px",
    border: "1px solid black",
    borderRadius: "10px",
    maxWidth: "500px",
    margin: "auto",
  },
};

export default TravelPlanner;
